import React from "react";
import "./Korpica.css";

export default function Korpica({ cartItems }) {
  console.log(cartItems);
  return (
    <div className="korpicaa" id="korpicaa">
      <div className="glavniDiv">
        {cartItems.map((item) => {
          return (
            <div key={item.id} className="itemuKorpici">
              {item.naziv} {item.kolicina}
            </div>
          );
        })}
      </div>
      <div className="checkoutDugme">CHECKOUT</div>
    </div>
  );
}
